import React from "react";

const Test = () => {
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>My tickets</h1>
      
      <div style={styles.searchContainer}>
        <span style={styles.searchLabel}>Search</span>
        <div style={styles.searchOptions}>
          <span style={styles.searchOption}>All requests</span>
          <span style={styles.searchOption}>Sort</span>
          <span style={styles.searchOption}>Updated at</span>
        </div>
      </div>

      <hr style={styles.divider} />

      <div style={styles.newTicket}>
        <strong>New ticket</strong>
      </div>

      <hr style={styles.divider} />

      <h2 style={styles.noRecords}>No records found</h2>

      <div style={styles.pagination}>
        <span>Showing 1 to 0 of 0 results</span>
        <div style={styles.paginationButtons}>
          <button style={styles.paginationButton}>Previous</button>
          <button style={styles.paginationButton}>Next</button>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    maxWidth: "800px",
    margin: "0 auto",
    padding: "20px",
    color: "#333",
  },
  title: {
    fontSize: "24px",
    marginBottom: "20px",
    color: "#2c3e50",
  },
  searchContainer: {
    display: "flex",
    alignItems: "center",
    marginBottom: "15px",
  },
  searchLabel: {
    fontWeight: "bold",
    marginRight: "10px",
  },
  searchOptions: {
    display: "flex",
    gap: "15px",
  },
  searchOption: {
    color: "#3498db",
    cursor: "pointer",
  },
  divider: {
    border: "none",
    borderTop: "1px solid #e0e0e0",
    margin: "20px 0",
  },
  newTicket: {
    color: "#3498db",
    margin: "15px 0",
    fontSize: "16px",
  },
  noRecords: {
    textAlign: "center",
    color: "#7f8c8d",
    margin: "40px 0",
    fontSize: "20px",
  },
  pagination: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    color: "#7f8c8d",
    marginTop: "30px",
  },
  paginationButtons: {
    display: "flex",
    gap: "10px",
  },
  paginationButton: {
    padding: "5px 10px",
    backgroundColor: "#f5f5f5",
    border: "1px solid #ddd",
    borderRadius: "3px",
    cursor: "pointer",
  },
};

export default Test;
